import React, { Component } from 'react';

import {
  Title,
  Button,
} from 'shipnow-mercurio';

import {
  Columns,
  Column,
  Level,
  LevelLeft,
  LevelRight
} from 'bloomer'

class ServicesList extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return(
      <React.Fragment>
        <Level>
          <LevelLeft>
            <Title>Lista de servicios</Title>
          </LevelLeft>
          <LevelRight>
            <Button kind="outline">Crear servicio</Button>
          </LevelRight>
        </Level>
      </React.Fragment> )
  }

}

export default ServicesList;
